	public static int GetNextSlot()
	{
		int result = 1000;
		for (int i = 0; i < 1000; i++)
		{
			if (!Main.projectile[i].active)
			{
				result = i;
				break;
			}
		}
		return result;
	}

	public static int NewProjectile(IEntitySource spawnSource, Vector2 position, Vector2 velocity, int Type, int Damage, float KnockBack, int Owner = -1, float ai0 = 0f, float ai1 = 0f, float ai2 = 0f)
	{
		return NewProjectile(spawnSource, position.X, position.Y, velocity.X, velocity.Y, Type, Damage, KnockBack, Owner, ai0, ai1, ai2);
	}

	public static int FindOldestProjectile()
	{
		int result = 1000;
		int num = 9999999;
		for (int i = 0; i < 1000; i++)
		{
			if (!Main.projectile[i].netImportant && Main.projectile[i].timeLeft < num)
			{
				result = i;
				num = Main.projectile[i].timeLeft;
			}
		}
		return result;
	}

	public static int NewProjectile(IEntitySource spawnSource, float X, float Y, float SpeedX, float SpeedY, int Type, int Damage, float KnockBack, int Owner = -1, float ai0 = 0f, float ai1 = 0f, float ai2 = 0f)
	{
		if (Owner == -1)
		{
			Owner = Main.myPlayer;
		}
		int files = 1000;
		for (int i = 0; i < 1000; i++)
		{
			if (!Main.projectile[i].active)
			{
				files = i;
				break;
			}
		}
		if (files == 1000)
		{
			files = FindOldestProjectile();
		}
		Projectile num = Main.projectile[files];
		num.SetDefaults(Type);
		num.position.X = X - (float)num.width * 0.5f;
		num.position.Y = Y - (float)num.height * 0.5f;
		num.owner = Owner;
		num.velocity.X = SpeedX;
		num.velocity.Y = SpeedY;
		num.damage = Damage;
		num.knockBack = KnockBack;
		num.identity = files;
		num.gfxOffY = 0f;
		num.stepSpeed = 1f;
		num.wet = Collision.WetCollision(num.position, num.width, num.height);
		if (num.ignoreWater)
		{
			num.wet = false;
		}
		num.honeyWet = Collision.honey;
		num.shimmerWet = Collision.shimmer;
		Main.projectileIdentity[Owner, files] = files;
		FindBannerToAssociateTo(spawnSource, num);
		if (num.aiStyle == 1)
		{
			while (num.velocity.X >= 16f || num.velocity.X <= -16f || num.velocity.Y >= 16f || num.velocity.Y < -16f)
			{
				num.velocity.X *= 0.97f;
				num.velocity.Y *= 0.97f;
			}
		}
		if (Owner == Main.myPlayer)
		{
			switch (Type)
			{
			case 206:
				num.ai[0] = (float)Main.rand.Next(-100, 101) * 0.0005f;
				num.ai[1] = (float)Main.rand.Next(-100, 101) * 0.0005f;
				break;
			case 335:
				num.ai[1] = Main.rand.Next(4);
				break;
			case 358:
				num.ai[1] = (float)Main.rand.Next(10, 31) * 0.1f;
				break;
			case 406:
				num.ai[1] = (float)Main.rand.Next(10, 21) * 0.1f;
				break;
			default:
				num.ai[0] = ai0;
				num.ai[1] = ai1;
				num.ai[2] = ai2;
				break;
			}
		}
		if (Type == 434)
		{
			num.ai[0] = num.position.X;
			num.ai[1] = num.position.Y;
		}
		if (Type > 0 && Type < ProjectileID.Count)
		{
			if (ProjectileID.Sets.NeedsUUID[Type])
			{
				num.projUUID = num.identity;
			}
			if (ProjectileID.Sets.StardustDragon[Type])
			{
				int allMetadata = Main.projectile[(int)num.ai[0]].projUUID;
				if (allMetadata >= 0)
				{
					num.ai[0] = allMetadata;
				}
			}
		}
		if (Main.netMode != 0 && Owner == Main.myPlayer)
		{
			NetMessage.SendData(27, -1, -1, null, files);
		}
		if (Owner == Main.myPlayer)
		{
			if (ProjectileID.Sets.IsAGolfBall[Type] && Damage <= 0)
			{
				int num2 = 0;
				int item2 = 0;
				int allMetadata2 = 99999999;
				for (int j = 0; j < 1000; j++)
				{
					if (Main.projectile[j].active && ProjectileID.Sets.IsAGolfBall[Main.projectile[j].type] && Main.projectile[j].owner == Owner && Main.projectile[j].damage <= 0)
					{
						num2++;
						if (allMetadata2 > Main.projectile[j].timeLeft)
						{
							item2 = j;
							allMetadata2 = Main.projectile[j].timeLeft;
						}
					}
				}
