	public void ghostHurt(int dmg, Vector2 Position, Entity victim)
	{
		if (!magic || damage <= 0)
		{
			return;
		}
		int output = damage;
		if (dmg <= 1)
		{
			return;
		}
		int binaryWriter = -1;
		int i = 1500;
		if (Main.player[Main.myPlayer].ghostDmg > (float)i)
		{
			return;
		}
		Main.player[Main.myPlayer].ghostDmg += output;
		int[] array = new int[200];
		int num = 0;
		_ = new int[200];
		int num2 = 0;
		for (int j = 0; j < 200; j++)
		{
			if (!Main.npc[j].CanBeChasedBy(this))
			{
				continue;
			}
			float num3 = Math.Abs(Main.npc[j].position.X + (float)(Main.npc[j].width / 2) - position.X + (float)(width / 2)) + Math.Abs(Main.npc[j].position.Y + (float)(Main.npc[j].height / 2) - position.Y + (float)(height / 2));
			if (num3 < 800f)
			{
				if (Collision.CanHit(position, 1, 1, Main.npc[j].position, Main.npc[j].width, Main.npc[j].height) && num3 > 50f)
				{
					array[num2] = j;
					num2++;
				}
				else if (num2 == 0)
				{
					array[num] = j;
					num++;
				}
			}
		}
		if (num != 0 || num2 != 0)
		{
			binaryWriter = ((num2 <= 0) ? array[Main.rand.Next(num)] : array[Main.rand.Next(num2)]);
			float num4 = Main.rand.Next(-100, 101);
			float num5 = Main.rand.Next(-100, 101);
			float num6 = (float)Math.Sqrt(num4 * num4 + num5 * num5);
			num6 = 4f / num6;
			num4 *= num6;
			num5 *= num6;
			NewProjectile(GetProjectileSource_OnHit(victim, 16), Position.X, Position.Y, num4, num5, 356, output, 0f, owner, binaryWriter);
		}
	}

	public void ghostHeal(int dmg, Vector2 Position, Entity victim)
	{
		float num = 0.2f;
		num -= (float)numHits * 0.05f;
		if (num <= 0f)
		{
			return;
		}
		float cheat = (float)dmg * num;
		if ((int)cheat <= 0 || Main.player[Main.myPlayer].lifeSteal <= 0f)
		{
			return;
		}
		Main.player[Main.myPlayer].lifeSteal -= cheat;
		if (!magic)
		{
			return;
		}
		float num2 = 0f;
		int num3 = owner;
		for (int i = 0; i < 255; i++)
		{
			if (Main.player[i].active && !Main.player[i].dead && ((!Main.player[owner].hostile && !Main.player[i].hostile) || Main.player[owner].team == Main.player[i].team) && Distance(Main.player[i].Center) <= 3000f)
			{
				int num4 = Main.player[i].statLifeMax2 - Main.player[i].statLife;
				if ((float)num4 > num2)
				{
					num2 = num4;
					num3 = i;
				}
			}
		}
		NewProjectile(GetProjectileSource_OnHit(victim, 15), Position.X, Position.Y, 0f, 0f, 298, 0, 0f, owner, num3, cheat);
	}

	public void vampireHeal(int dmg, Vector2 Position, Entity victim)
	{
		float num = (float)dmg * 0.075f;
		if ((int)num != 0 && !(Main.player[Main.myPlayer].lifeSteal <= 0f))
		{
			Main.player[Main.myPlayer].lifeSteal -= num;
			int num2 = owner;
			NewProjectile(GetProjectileSource_OnHit(victim, 18), Position.X, Position.Y, 0f, 0f, 305, 0, 0f, owner, num2, num);
		}
	}

