		int num2 = width / 2 + distFluff;
		for (int i = layerStart; i < layerEnd; i += layerJump)
		{
			int num3 = i;
			for (int j = rCurrentNPC.X; j <= screenPos.X; j++)
			{
				for (int k = rCurrentNPC.Y; k <= screenPos.Y; k++)
				{
