					for (int l = 0; l < num4; l++)
					{
						Dust obj = Main.dust[WorldGen.KillTile_MakeTileDust(j, k, tileSafely)];
						obj.velocity.Y -= 3f + (float)num3 * 1.5f;
						obj.velocity.Y *= Main.rand.NextFloat();
						obj.scale += (float)num3 * 0.03f;
					}
					if (num3 >= 2)
					{
						for (int m = 0; m < num4 - 1; m++)
