					if (num4 > 0 && Main.rand.Next(3) != 0)
					{
						float num5 = (float)Math.Abs(num - j) / (MAX_SPREAD / 2f);
						Gore gore = Gore.NewGoreDirect(position, Vector2.Zero, 61 + Main.rand.Next(3), 1f - (float)num3 * 0.15f + num5 * 0.5f);
