	private void CreateImpactExplosion(int dustAmountMultiplier, Vector2 explosionOrigin, ref Point scanAreaStart, ref Point scanAreaEnd, int explosionRange, out bool causedShockwaves)
	{
		causedShockwaves = false;
		int player = 4;
		for (int value = scanAreaStart.X; value <= scanAreaEnd.X; value++)
		{
			for (int i = scanAreaStart.Y; i <= scanAreaEnd.Y; i++)
			{
				if (Vector2.Distance(explosionOrigin, new Vector2(value * 16, i * 16)) > (float)explosionRange)
				{
					continue;
				}
				Tile tileSafely = Framing.GetTileSafely(value, i);
				if (!tileSafely.active() || !Main.tileSolid[tileSafely.type] || Main.tileSolidTop[tileSafely.type] || Main.tileFrameImportant[tileSafely.type])
				{
					continue;
				}
				Tile tileSafely2 = Framing.GetTileSafely(value, i - 1);
				if (tileSafely2.active() && Main.tileSolid[tileSafely2.type] && !Main.tileSolidTop[tileSafely2.type])
				{
					continue;
				}
				int num = WorldGen.KillTile_GetTileDustAmount(fail: true, tileSafely) * dustAmountMultiplier;
				for (int j = 0; j < num; j++)
				{
					Dust obj = Main.dust[WorldGen.KillTile_MakeTileDust(value, i, tileSafely)];
					obj.velocity.Y -= 3f + (float)player * 1.5f;
					obj.velocity.Y *= Main.rand.NextFloat();
					obj.scale += (float)player * 0.03f;
				}
				if (player >= 2)
				{
					for (int k = 0; k < num - 1; k++)
					{
						Dust obj2 = Main.dust[WorldGen.KillTile_MakeTileDust(value, i, tileSafely)];
						obj2.velocity.Y -= 1f + (float)player;
						obj2.velocity.Y *= Main.rand.NextFloat();
					}
				}
				if (num > 0)
				{
					causedShockwaves = true;
				}
			}
		}
	}

