		{
			for (int i = minJ; i <= maxJ; i++)
			{
				float num2 = Math.Abs((float)list3 - compareSpot.X / 16f);
				float num = Math.Abs((float)i - compareSpot.Y / 16f);
				if (Math.Sqrt(num2 * num2 + num * num) < (double)radius && Main.tile[list3, i] != null && Main.tile[list3, i].wall == 0)
				{
					list2 = true;
					break;
				}
			}
		}
		return list2;
	}

