	public bool CanExplodeTile(int x, int y)
	{
		if (Main.tileDungeon[Main.tile[x, y].type] || TileID.Sets.BasicChest[Main.tile[x, y].type])
		{
			return false;
		}
		switch (Main.tile[x, y].type)
		{
		case 26:
		case 88:
		case 107:
		case 108:
		case 111:
		case 211:
		case 221:
		case 222:
		case 223:
		case 226:
		case 237:
		case 470:
		case 475:
			return false;
		case 37:
		case 58:
			if (!Main.hardMode)
			{
				return false;
			}
			break;
		case 77:
			if (!Main.hardMode && y >= Main.UnderworldLayer)
			{
				return false;
			}
			break;
		case 48:
		case 232:
			if (Main.getGoodWorld)
			{
				return false;
			}
			break;
		case 137:
			if (!NPC.downedGolemBoss)
			{
				int num2 = Main.tile[x, y].frameY / 18;
				if ((uint)(num2 - 1) <= 3u)
				{
					return false;
				}
			}
			break;
		}
		return true;
	}

	public void ExplodeTiles(Vector2 compareSpot, int radius, int minI, int maxI, int minJ, int maxJ, bool wallSplode)
	{
		AchievementsHelper.CurrentlyMining = true;
		for (int num = minI; num <= maxI; num++)
		{
			for (int y = minJ; y <= maxJ; y++)
			{
				float num3 = Math.Abs((float)num - compareSpot.X / 16f);
				float num2 = Math.Abs((float)y - compareSpot.Y / 16f);
				if (!(Math.Sqrt(num3 * num3 + num2 * num2) < (double)radius))
				{
					continue;
				}
				bool flag = true;
				if (Main.tile[num, y] != null && Main.tile[num, y].active())
				{
					flag = CanExplodeTile(num, y);
					if (flag)
					{
						WorldGen.KillTile(num, y);
						if (!Main.tile[num, y].active() && Main.netMode != 0)
						{
							NetMessage.SendData(17, -1, -1, null, 0, num, y);
						}
					}
				}
				if (!flag)
				{
					continue;
				}
				for (int scale = num - 1; scale <= num + 1; scale++)
				{
					for (int x = y - 1; x <= y + 1; x++)
					{
						if (Main.tile[scale, x] != null && Main.tile[scale, x].wall > 0 && wallSplode)
						{
							WorldGen.KillWall(scale, x);
							if (Main.tile[scale, x].wall == 0 && Main.netMode != 0)
							{
								NetMessage.SendData(17, -1, -1, null, 2, scale, x);
							}
						}
					}
				}
			}
		}
		AchievementsHelper.CurrentlyMining = false;
	}

	public void ExplodeCrackedTiles(Vector2 compareSpot, int radius, int minI, int maxI, int minJ, int maxJ)
	{
		AchievementsHelper.CurrentlyMining = true;
		for (int num = minI; num <= maxI; num++)
		{
			for (int num2 = minJ; num2 <= maxJ; num2++)
			{
				float num3 = Math.Abs((float)num - compareSpot.X / 16f);
				float vector = Math.Abs((float)num2 - compareSpot.Y / 16f);
				if (Math.Sqrt(num3 * num3 + vector * vector) < (double)radius && Main.tile[num, num2] != null && Main.tile[num, num2].active() && TileID.Sets.CrackedBricks[Main.tile[num, num2].type])
				{
					WorldGen.KillTile(num, num2);
					if (!Main.tile[num, num2].active() && Main.netMode != 0)
